#include <string>
#include <limits>
#include <algorithm>
using std::string;

class Solution {
  public:
    string shortestPalindrome(const string& s) {
        if (s.empty()) return "";

        int shortest_idx = 0;

        for (int i = (s.size() + 1) / 2; i >= 0; --i) {
            for (int x = 0; x < 2; ++x) {
                int left = i;
                int right = i + x;

                while (left >= 0) {
                    if (s[left] != s[right]) {
                        break;
                    }
                    --left, ++right;
                }

                if (left == -1) {
                    if (right == s.size()) {
                        return s;
                    }

                    shortest_idx = right;
                }
            }
        }

        string sub(s.substr(shortest_idx));
        std::reverse(sub.begin(), sub.end());
        return sub + s;
    }
};

#include <iostream>
using namespace std;

int main() {
    // string s = Solution().shortestPalindrome("abbacd");
    // string s = Solution().shortestPalindrome("aba");
    string s = Solution().shortestPalindrome("");
    cout << s << endl;
    return 0;
}
